import React from 'react';
import './App.css';
import Header from './Header';
import Footer from './Footer';

function App() {
  return (
            <>
              <div> 
                <Header/>

                  <div style={{minHeight:"480px",backgroundColor:"lightblue"}}>

                   <input type="text" name="text" placeholder="Text" />

                   <input type="textcontent" name="content" placeholder="Enter something"/>



                  </div>

                <Footer/>
              </div>
            </>

          );
}

export default App;
